import React from 'react';
import login from '../../assets/images/appointment.png';
const Contact = () => {
    return (
        <div style={{background:`url(${login})`}} className='contact flex justify-center items-center py-10'>
            <h6 className="title">Contact Us</h6>
            <h3 className='font-light text-3xl'>Stay connected with us</h3>
            <div>
                <input type="text" placeholder="Type here" class="input input-bordered w-full max-w-xs" />
                <input type="text" placeholder="Type here" class="input input-bordered w-full max-w-xs" />
                <input type="text" placeholder="Type here" class="input input-bordered w-full max-w-xs" />
                <button type='submit'>submit</button>
            </div>
        </div>
    );
};

export default Contact;
